import React from "react";
import { Typography, Button, Box } from "@mui/material";
import { useNavigate } from "react-router-dom";
import "";

const Quiz = () => {
  const navigate = useNavigate();

  const endQuiz = () => {
    // Rediriger à la page d'accueil ou ailleurs après le quiz
    navigate("/");
  };

  return (
    <Box 
      display="flex" 
      justifyContent="center" 
      alignItems="center" 
      height="100vh" 
      flexDirection="column"
    >
      <Typography variant="h4" gutterBottom>
        Quiz en cours...
      </Typography>
      {/* Vous pouvez ajouter des questions de quiz ici */}
      <Button 
        variant="contained" 
        color="secondary" 
        onClick={endQuiz} 
        size="large"
      >
        Terminer le Quiz
      </Button>
    </Box>
  );
};

export default Quiz;
